import React from 'react'
import './Footer.css'

const Footer = () => {

  return (
    <footer>
      <p className="copyright">
        Hecho con{' '}
        <span role="img" aria-label="thinking">
          ❤️
        </span>{' '}
        por Flo Belascuain - 2022
      </p>
    </footer>
  )
}

export default Footer
